description:
When a veteran conductor, a young pre-med student and a struggling salesman discover a dead body onboard a night train, the three strangers find themselves on a collision course with destiny. Among the deceased man's possessions is a mysterious box, containing a treasure so valuable that they conspire to keep it for themselves. Their decision sets in motion a tense game of obsession and deceit, where greed betrays reason and morality gives way to temptation...
